import React from 'react';
import Hour from './Hour/Hour';


const hours = (props) => props.hours.map((hour) => {
        return (
              <div className="displayColumn">
              <Hour
            key={hour.id}
            id={hour.id}
            hour={hour.time} 
            temperature={hour.temperature}
            />
              </div>
        );
      });

export default hours;
